import React from 'react';
import {Formik, Form, Field} from 'formik';

const ContactForm = () => {
  return (
    <>
    <Formik
    initialValues={{
        name: '',
        tittle: '',
        email: '',
        message: '',
    }}
    onSubmit={()=>{
        console.log('formulario enviado exitosamente')
    }
    }
    >
        <Form className='formulario'>   
        <Field type="text" className="input_form" id="name" placeholder="Ingrese su nombre" required/>
        <Field type="text" className="input_form" id="tittle" placeholder="Ingrese el asunto" required/>
        <Field type="email" className="input_form" id="email" placeholder="name@example.com" required/>
        <textarea className="textarea_form" id="message" rows="3" placeholder="Ingrese su mensaje"></textarea>
        <button type="submit" className="btn btn-outline-info btn-lg">Enviar</button>
        </Form>
    </Formik>
    
    </>
  )
}

export default ContactForm
